function FormDate(props) {
  return (
    <div className={props.classNameContainer}>
      <label className={style.label}>date</label>
      <input
        value={formData.date}
        className={style.input}
        type="date"
        onChange={dateChangeHandler}
      ></input>
    </div>
  );
}

export default FormDate;
